import React from "react";
import { Link } from 'react-router-dom';
import book from "../images/books.svg"
import ebook from '../images/kindle.png';
import borrowed from "../images/borrow.png";
import wishlist from "../images/heart.png"


export default function Main() {

    return(
        <div className="main">
            <div className="books-container">
                <Link to="/books"><img src={book} alt="książki"/></Link>
                <h2>książki</h2>
                <p>sprawdź, co już masz na papierze</p>
            </div>
            <div className="books-container">
                <Link to="/ebooks"><img src={ebook} alt="książki"/></Link>
                <h2>ebooki</h2>
                <p>sprawdź, co już masz na kindlu</p>
            </div>
            <div className="borrowed-container">
                {/*link to*/}
                <Link to="/borrowed"><img src={borrowed} alt="wypożyczone"/></Link>
                <h2>wypożyczone</h2>
                <p>zapisz, żeby nie zapomnieć</p>
            </div>
            <div className="wishlist-container">
                <Link to="/wishlist"><img src={wishlist} alt="wishlist"/></Link>
                <h2>wishlist</h2>
                <p>zapamiętaj, co chcesz kupić</p>
            </div>
        </div>
    )
};
